import Counter from "./counter";
import { useState } from "react";

function Counters() {
  const [counters] = useState([
    { id: 1, value: 10 },
    { id: 2, value: 7 },
    { id: 3, value: 2 },
    { id: 4, value: 80 },
  ]);

  return (
    <div>
      {counters.map((counter) => (
        <Counter key={counter.id} value={counter.value} selected>
          <h4>Counter #{counter.id}</h4>
        </Counter>
      ))}
    </div>
  );
}
export default Counters;
